//Import component and css
import React from "react";
import "../css/ExpenseForm.css";

const ExpenseForm = () => {
  return <form>
      <div className="new-expense__controls">
          <div className="new-exprense__control">
              <label for="newTitle">Title</label>
              <input type="text" id="newTitle" required />
          </div>
          <div className="new-exprense__control">
              <label for="newAmount">Amount</label>
              <input type="number" min="0.01" step="0.01" id="newAmount" required />
          </div>
          <div className="new-exprense__control">
              <label for="newDate">Date</label>
              <input type="date" id="newDate" min="2019-01-01" max="2022-12-31" required />
          </div>
      </div>
      <div className="new-exprense__actions">
        <button type="submit">Add Expense</button>
      </div>
  </form>;
};

//Export component
export default ExpenseForm;
